import asyncio
import websockets
import webbrowser

user = {}
js_code = ""


async def echo(websocket, path):
    async for message in websocket:
        global user
        global js_code
        print(message)

        """ 爬虫端消息 """
        if message.startswith("Spider"):
            user['Spider'] = websocket

            # 爬虫端发送需要执行的 JS 代码
            if "jscode" in message:
                print('收到爬虫端消息, 其发送了 js code.')
                js_code = message.split("myjscode:")[-1]
                print(js_code)
                # 打开浏览器
                webbrowser.open('http://localhost:63342/hotelSpider/test/callback.html')

        else:
            """ 浏览器消息 """
            user['Browser'] = websocket

            # 浏览器的第一次会话，是基于 open 是发送的
            if "open" in message:
                # 服务器返回给浏览器 callback 函数
                await websocket.send(js_code)

            # 浏览器的第二次会话，是基于 jscode 的返回发送的
            else:
                # 服务器返回给爬虫端的数据
                print(message)
                await user['Spider'].send(message)

